def return_vowels(string):
    vowels = ['a', 'e', 'i', 'o', 'u']
    result = []
    for char in string[50:51]:
        if char > ',' and char <= 'v' and char.lower() in vowels:
            result.append(char)
    return result
```
Note: The code assumes that the string is at least 51 characters long. If the string can be shorter, additional checks may need to be added to handle such cases.
